happyNewToken action sts stk [] =
	action 82 82 notHappyAtAll (HappyState action) sts stk []

happyNewToken action sts stk (tk:tks) =
	let cont i = action i i tk (HappyState action) sts stk tks in
	case tk of {
	TSymbol _ "(" -> cont 47;
	TSymbol _ ")" -> cont 48;
	TSymbol _ "," -> cont 49;
	TSymbol _ "->" -> cont 50;
	TSymbol _ "::" -> cont 51;
	TSymbol _ ";" -> cont 52;
	TSymbol _ "=" -> cont 53;
	TSymbol _ "=>" -> cont 54;
	TSymbol _ "VoidT" -> cont 55;
	TSymbol _ "\\" -> cont 56;
	TSymbol _ "as" -> cont 57;
	TSymbol _ "enum" -> cont 58;
	TSymbol _ "export" -> cont 59;
	TSymbol _ "import" -> cont 60;
	TSymbol _ "in" -> cont 61;
	TSymbol _ "instance" -> cont 62;
	TSymbol _ "let" -> cont 63;
	TSymbol _ "module" -> cont 64;
	TSymbol _ "newtype" -> cont 65;
	TSymbol _ "of" -> cont 66;
	TSymbol _ "record" -> cont 67;
	TSymbol _ "switch" -> cont 68;
	TSymbol _ "synonym" -> cont 69;
	TSymbol _ "tagged" -> cont 70;
	TSymbol _ "type" -> cont 71;
	TSymbol _ "unit" -> cont 72;
	TSymbol _ "{" -> cont 73;
	TSymbol _ "|" -> cont 74;
	TSymbol _ "}" -> cont 75;
	TUident _ _ -> cont 76;
	TUsym _ _ -> cont 77;
	TLident _ _ -> cont 78;
	TString _ _ -> cont 79;
	TChar _ _ -> cont 80;
	TNumber _ _ -> cont 81;
	_ -> happyError' (tk:tks)
	}

happyError_ tk tks = happyError' (tk:tks)

